import { Typography, Button } from "@material-ui/core";
import { KeyboardArrowRight } from "@material-ui/icons";

const Create = () => {
  return (
    <div>
      <Typography variant="h1" component="h6">
        create A new Node
      </Typography>
      <Button
        color=" secondary"
        type="submit"
        variant="contained"
        endIcon={<KeyboardArrowRight />}
      >
        Submit
      </Button>
    </div>
  );
};

export default Create;
